import { useState } from "react";
import { jsx, Styled } from "theme-ui";

export default function Button(props) {
  const backgroundColor = props.theme;

  return (
    <Styled.a>
      <Styled.div
        sx={{
          cursor: "pointer",
          mr: 2,
          backgroundColor: backgroundColor,
          p: 2,
          borderRadius: 16,
        }}
      >
        <Styled.h5
          sx={{
            fontSize: [2, 3, 4],
          }}
        >
          {props.data}
        </Styled.h5>
      </Styled.div>
    </Styled.a>
  );
}
